import {Component} from 'react'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super()
    this.state={
      monsters:[{
        name:"Linda",
        id:"2346"
      },
     {
        name:"Jessica",
        id:"2334"
      },
     {
        name:"Kim",
        id:"2344"
      },
      {
        name:"Leah",
        id:"2345"
      }
    ]

    } 
  }
  render (){
    return (
      <div className="App">
       {
          this.state.monsters.map((monster)=>{
          return <h1 key={monster.id}>{monster.name}</h1>
          })
       }

      </div>
    );
  }
}

export default App;
